webpackJsonp([0x5f713d766420],{3999:function(n,e){n.exports={data:{markdownRemark:{html:"<p><strong>(2008/4/10)旧版の動作サポート終了</strong> </p>\n<p>本日より、v0.1i以前のあらゆるサポートを終了しました。サポート終了対象のFLANを使用している方は早めのバージョンアップを勧めます。</p>\n<h2>(2006/10/23)v0.2cの仕様変更について</h2>\n<p>スクリプト製作者の方は下記の変更がありますので熟知の上バージョンアップの程お願いします。</p>\n<ul>\n<li><em>ステージ開始からのフレーム数が格納されるメンバ変数m</em>nFlanStageCountが廃止となりました。_</li>\n</ul>\n<p><strong>(2006/10/9)v0.2aの仕様変更について</strong> </p>\n<p>スクリプト製作者の方は下記の変更がありますので熟知の上バージョンアップの程お願いします。</p>\n<ul>\n<li><em>FLAN</em>ESS<em>ARGV</em>DEFAULTをFLAN<em>ENEMY</em>ARGV<em>DEFAULTと名称変更し、弾スクリプトからは使用できなくなりました。</em></li>\n<li><em>FLAN</em>ENEMY<em>ITEM</em>WIDTHをFLAN<em>ITEM</em>WIDTHと名称変更しました。_</li>\n<li><em>CreateStackの引数が1つ増えました。</em></li>\n</ul>\n<p><strong>(2006/8/27)インストールフォルダの変更</strong> </p>\n<p>v0.1gよりインストールフォルダが従来までの“th<em>dnh/FLAN”から“th</em>dnh/lib/FLAN”に変更となりました。</p>",frontmatter:{cover:null,date:"2006-07-21T00:00:58+09:00",strDate:"2006/7/20",title:"告知"}}},pathContext:{path:"/ja/blog/2006/07/21-告知/",langKey:"ja"}}}});
